export default function HeaderNav(props){
    return(
    <nav className="navbar">
    Link    
       <a href="/about" onClick={props.aboutClick}>about</a>
       <a href="/orders">orders</a>
       <a href="/shop">shop</a>
       <a href="/contact">contact</a>
    </nav>
    )
}
